import React from "react";
import { CSSTransition } from "react-transition-group";
import '../ModalAnimations.css'
import MusicItems from "../UI/button/MusicItems";

const SearchModal = ({ isOpen, doSearh, musics }) => {

    return (
        <CSSTransition
            in={isOpen}
            timeout={300}
            classNames="search"
            unmountOnExit>
            <div className="fixed inset-0 h-[80px] mt-[105px] right-10">
                <div className="">
                    <div>
                        <h1 className="ml-3 text-white">Songy syranystar:</h1>
                        <ul className="mt-3">{doSearh.map((musics) => (
                            <li className="ml-3 mt-2 gap-24"><MusicItems props={musics} /></li>
                        ))}</ul>
                    </div>
                </div>
            </div>


        </CSSTransition>
    )
}

export default SearchModal;
